import React from 'react';
import PropTypes from 'prop-types';

const RepoItem = ({ repo }) => {
    return (
        <div className='card'>
            <h3>
                <a href={repo.html_url} target='_blank'>
                    {repo.name}
                </a>
            </h3>
        </div>
    );
};

RepoItem.protoTypes = {
    repo: PropTypes.object.isRequired
};

export default RepoItem;
